      "body": "![image](https://user-images.githubusercontent.com/1237971/66273778-09816680-e86f-11e9-8c1d-a9cd5233ab0e.png)\r\n\r\nFixes #1097\r\n\r\n* Add validation for connected network\r\n* Add an error subtitle in Onboarding/Create.js\r\n* Add a NetworkRedirectModal\r\n* Add a validate() function inside Onboarding/Onboarding.js\r\n\r\nNote: \r\n\r\n* The client will attempt to redirect the user to the right network if it's supported in selectorNetworks. Otherwise, it will attempt to redirect to mainnet. \r\n\r\n* The validation will only take place when clicking on \"Create\". It won't check during the `create` process.\r\n\r\n* The modal might be a little narrow for the text, but I didn't know the best practice to enlarge it.\r\n\r\n* Like the account address, the network might not be available immediately. I tested as much as I could to avoid this, but if you see nothing instead of {actual} it might be a problem.\r\n\r\n(This is my first PR here, please give feedback, especially regarding to code quality, wording and design :) )\r\n\r\nDEMO: https://youtu.be/A2oqP2SBJtM\r\n\r\nNote: I rebased and updated this as it was stale. For some reason the update wasn't mirror on the main repo PR so I re-created the PR altogether.",
