      "title": "Add opt-in centralised cache",
      "user": {
        "login": "onbjerg",
        "id": 8862627,
        "node_id": "MDQ6VXNlcjg4NjI2Mjc=",
        "avatar_url": "https://avatars0.githubusercontent.com/u/8862627?v=4",
        "gravatar_id": "",
        "url": "https://api.github.com/users/onbjerg",
        "html_url": "https://github.com/onbjerg",
        "followers_url": "https://api.github.com/users/onbjerg/followers",
        "following_url": "https://api.github.com/users/onbjerg/following{/other_user}",
        "gists_url": "https://api.github.com/users/onbjerg/gists{/gist_id}",
        "starred_url": "https://api.github.com/users/onbjerg/starred{/owner}{/repo}",
        "subscriptions_url": "https://api.github.com/users/onbjerg/subscriptions",
        "organizations_url": "https://api.github.com/users/onbjerg/orgs",
        "repos_url": "https://api.github.com/users/onbjerg/repos",
        "events_url": "https://api.github.com/users/onbjerg/events{/privacy}",
        "received_events_url": "https://api.github.com/users/onbjerg/received_events",
        "type": "User",
        "site_admin": false
      },
      "body": "**PoC, do not merge**\r\n\r\nAdds support for [Feather](https://github.com/onbjerg/feather), a cache server for Aragon orgs.\r\n\r\nThe implementation itself is [around 11 lines of code](https://github.com/aragon/aragon/compare/master...onbjerg:feather-cache?expand=1#diff-c1957ab402163ee0da348f170f242479R328-R343), the rest is adding two settings:\r\n\r\n- The Feather node URL\r\n- An opt-in\r\n\r\nUsers can opt in to having organisations they visit cached. When they visit an organisation that is in cache, then it is served near instantly on any device they have opted in to this service on.\r\n\r\nUsers can run their own caching servers if they wish to defer trust to someone else. Currently a PoC server is running on http://bzz.cool:3333.\r\n\r\nThere are some additional steps I would like to take in the future on this, namely a verification mechanism for the cache. \r\n\r\n**[Video I sent to a friend demoing Feather](https://www.youtube.com/watch?v=BwMZyWVjeSY)**",
