      "body": "This is the main commit: https://github.com/aragon/aragon-ui/commit/34993b5ad38448da77cc25d07e801ba5b470b341\r\n\r\n> MainTheme has been removed and should be implemented on the app side if\r\nneeded (see devbox/components/current-theme.js or devbox/apps/Theme.js\r\nfor examples).\r\n>\r\n> This is because having sub themes in an app is not something people use\r\nat the moment, and being able to set the main theme as a prop makes\r\nthings easier to manage for custom themes.\r\n>\r\n> Custom themes are also always extending the base theme corresponding to\r\ntheir appearance, making the process of extending themes a bit easier.",
