      "title": "Add a babel plugin to handle the gu unit",
      "user": {
        "login": "bpierre",
        "id": 36158,
        "node_id": "MDQ6VXNlcjM2MTU4",
        "avatar_url": "https://avatars2.githubusercontent.com/u/36158?v=4",
        "gravatar_id": "",
        "url": "https://api.github.com/users/bpierre",
        "html_url": "https://github.com/bpierre",
        "followers_url": "https://api.github.com/users/bpierre/followers",
        "following_url": "https://api.github.com/users/bpierre/following{/other_user}",
        "gists_url": "https://api.github.com/users/bpierre/gists{/gist_id}",
        "starred_url": "https://api.github.com/users/bpierre/starred{/owner}{/repo}",
        "subscriptions_url": "https://api.github.com/users/bpierre/subscriptions",
        "organizations_url": "https://api.github.com/users/bpierre/orgs",
        "repos_url": "https://api.github.com/users/bpierre/repos",
        "events_url": "https://api.github.com/users/bpierre/events{/privacy}",
        "received_events_url": "https://api.github.com/users/bpierre/received_events",
        "type": "User",
        "site_admin": false
      },
      "body": "See discussion: https://github.com/aragon/aragon-ui/issues/333\r\n\r\n# babel-plugin-aragon-ui\r\n\r\nPlugin greatly inspired from [babel-plugin-styled-components](https://github.com/styled-components/babel-plugin-styled-components), and made to work with it.\r\n\r\n## What it does\r\n\r\nTransforms this:\r\n\r\n```jsx\r\n<div\r\n  css={`\r\n    width: 4gu;\r\n    height: 4gu;\r\n  `}\r\n/>\r\n```\r\n\r\nInto this:\r\n\r\n```jsx\r\n<div\r\n  css={`\r\n    width: 32px;\r\n    height: 32px;\r\n  `}\r\n/>\r\n```\r\n\r\n## Features\r\n\r\n- Adds the `gu` unit to styled component’s CSS blocks (in normal styled\r\n  components, in the `css` prop, or using the `css` helper).\r\n\r\n## Installation\r\n\r\nIn your .babelrc, declare this plugin before styled-components:\r\n\r\n```json\r\n{\r\n  \"plugins\": [\r\n    \"@aragon/babel-plugin-aragon-ui\",\r\n    \"styled-components\"\r\n  ]\r\n}\r\n```\r\n\r\n## To do\r\n\r\n- Support for text styles: `-ui-text-style: title1`\r\n- Support for theme values: `-ui-theme(surfaceContent)`\r\n\r\nNote: both are using the [CSS syntax for proprietary extensions](https://www.w3.org/TR/CSS22/syndata.html#vendor-keywords), but we might as well decide to drop them, or not follow it exactly (e.g. by removing the initial `-`).",
