      "body": "Allows to share an appearance and a theme with the apps running.\r\n\r\n`appearance` is set to either `light` or `dark`. Other values could be passed in the future (e.g. `black` for OLED screens). It is always present and apps should respect it and display a theme that correspond to it.\r\n\r\n`theme` contains the entire theme that should be rendered by the app. It is optional and apps should respect it when present. If not possible, apps should respect the `appearance`.\r\n\r\nTheme examples:\r\n\r\nhttps://github.com/aragon/aragon-ui/blob/master/src/theme/theme-light.js\r\nhttps://github.com/aragon/aragon-ui/blob/master/src/theme/theme-dark.js\r\n",
