      "title": "[Prototype] AragonApp: signed calls and multi call execution (aka meta-txs support)",
      "user": {
        "login": "izqui",
        "id": 447328,
        "node_id": "MDQ6VXNlcjQ0NzMyOA==",
        "avatar_url": "https://avatars3.githubusercontent.com/u/447328?v=4",
        "gravatar_id": "",
        "url": "https://api.github.com/users/izqui",
        "html_url": "https://github.com/izqui",
        "followers_url": "https://api.github.com/users/izqui/followers",
        "following_url": "https://api.github.com/users/izqui/following{/other_user}",
        "gists_url": "https://api.github.com/users/izqui/gists{/gist_id}",
        "starred_url": "https://api.github.com/users/izqui/starred{/owner}{/repo}",
        "subscriptions_url": "https://api.github.com/users/izqui/subscriptions",
        "organizations_url": "https://api.github.com/users/izqui/orgs",
        "repos_url": "https://api.github.com/users/izqui/repos",
        "events_url": "https://api.github.com/users/izqui/events{/privacy}",
        "received_events_url": "https://api.github.com/users/izqui/received_events",
        "type": "User",
        "site_admin": false
      },
      "body": "Super early prototype of how we could add a way to execute signed calls in a contract inheriting `AragonApp`. Signed calls allow the entity performing an action doing so without ever having to own any ETH to pay for transaction fees, by having a relayer submit their signed calls on-chain. There seems to be some momentum around the [EIP1077](https://eips.ethereum.org/EIPS/eip-1077) standard, which could be interesting to support, as a standard interface could help create a ecosystem of relayer services.\r\n\r\nBy putting this in the `AragonApp` contract, any Aragon app would automatically benefit from this functionality. There is native support for ACL checks, but apps willing to use this for custom logic (e.g. Voting) should use `AragonApp.sender()` instead of `msg.sender`.\r\n\r\nIt uses volatile storage, `AragonApp` will write to a storage slot who the actual sender of the call is before calling itself with that calldata. After the sub-call ends executing, that storage slot is emptied. This would be quite expensive to do right now, but the new [net gas metering](https://eips.ethereum.org/EIPS/eip-1283) in Constantinople this is quite cheap to do.\r\n\r\nGot down this rabbit-hole after having a discussing with @bingen about whether it would make sense to add [`multicall`](https://github.com/cartoucheco/registrar/blob/master/contracts/OwnedRegistrar.sol#L73-L77) to the Staking app, and his proposal to add it directly to `AragonApp`.\r\n\r\nThe current implementation doesn't allow to perform multiple calls from sender as in `multicall`, but it could be implemented by accepting empty signatures as calls executed by their sender.",
