      "body": "Status: WIP :construction: \r\n\r\n## Rationale\r\n\r\nRight now, a number of tests in the toolkit package are mocking a bit too much. This is ok for pure unit tests, but we want our tests to be more like integration tests.\r\n\r\nFor example, getApmRegistryPackages.test.js doesn't use a real version of apm.js, but mocks it. As a result, the test \"anchors\" the implementation of getApmRegistryPackages.js but doesn't really test if the function produces the expected results in a real environment.\r\n\r\nThis PR minimizes the use of mocking in the tests, shifting them from pure unit testing to integration testing, reducing the coverage of tests, but concentrating the testing on critical aspects of the toolkit package.\r\n\r\n## Tests to be ported (toolkit)\r\n- [x] apm\r\n  - [x] util/acl.test.js\r\n  - [x] getApmRegistryPackages.test.js\r\n  - [x] getApmRepo.test.js\r\n  - [x] getApmRepoVersions.test.js\r\n  - [x] grantNewVersionsPermission.test.js\r\n- [x] dao\r\n  - [x] apps.test.js\r\n  - [x] assign-id.test.js\r\n  - [x] encodeCall.test.js\r\n  - [x] new.test.js\r\n- [x] helpers\r\n  - [x] aragonjs-wrapper.test.js\r\n- [ ] ipfs\r\n  - [ ] config.test.js\r\n  - [ ] daemonAndConfig.test.js\r\n  - [ ] data-viz.test.js\r\n  - [ ] data.test.js\r\n  - [ ] propagation.test.js\r\n- [ ] token\r\n  - [ ] factory.test.js\r\n\r\n## Additional tasks\r\n- [ ] Remove mock helpers\r\n- [ ] No skipped or onlyed tests in toolkit",
