      "body": "Bumps [@aragon/wrapper](https://github.com/aragon/aragon.js) from 5.0.0-rc.17 to 5.0.0-rc.20.\n<details>\n<summary>Commits</summary>\n\n- [`2e86302`](https://github.com/aragon/aragon.js/commit/2e863028eb272a73bb62b768cd19d5aafaf8e3b8) wrapper: v5.0.0-beta.20\n- [`9357c3e`](https://github.com/aragon/aragon.js/commit/9357c3e20b7a23306f89bd3b1d79f2d4ffc23806) Wrapper: fix transaction pathing for directly accessible actions  ([#404](https://github-redirect.dependabot.com/aragon/aragon.js/issues/404))\n- [`7755a3f`](https://github.com/aragon/aragon.js/commit/7755a3faef5f504fcd68d8ee4885e975953052e8) wrapper: v5.0.0-beta.19\n- [`1d34edf`](https://github.com/aragon/aragon.js/commit/1d34edf55737c90ffcc6613c34ebe8453b250710) Wrapper: fix transaction creation failing due to fallback functions not havin...\n- [`2804c15`](https://github.com/aragon/aragon.js/commit/2804c15dce598fa03016f560d23f97296298b207) api: v2.0.0-beta.8\n- [`383fff9`](https://github.com/aragon/aragon.js/commit/383fff90ee6faaa60a4755bdd6e2711fbf098ae1) wrapper: v5.0.0-beta.18\n- [`cf3dfa7`](https://github.com/aragon/aragon.js/commit/cf3dfa7fb034e2edd7bfb2478580139bca7dc356) Wrapper: upgrade radspec ([#402](https://github-redirect.dependabot.com/aragon/aragon.js/issues/402))\n- [`c3cab8d`](https://github.com/aragon/aragon.js/commit/c3cab8d5e7b8792aca34c48ab16d1124ab161d02) api: allow intents to be sent with full method signatures ([#401](https://github-redirect.dependabot.com/aragon/aragon.js/issues/401))\n- [`e290489`](https://github.com/aragon/aragon.js/commit/e290489c7f7765e9a9e38cc5dbb2552f3bf57c4a) Wrapper: pass connected account as msg.sender to forwardFee call ([#397](https://github-redirect.dependabot.com/aragon/aragon.js/issues/397))\n- [`b94f002`](https://github.com/aragon/aragon.js/commit/b94f002b28ab9f021e1bd3db690e049a3841451c) API: event trigger ([#361](https://github-redirect.dependabot.com/aragon/aragon.js/issues/361))\n- Additional commits viewable in [compare view](https://github.com/aragon/aragon.js/compare/wrapper-v5.0.0-rc.17...wrapper-v5.0.0-rc.20)\n</details>\n<br />\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=@aragon/wrapper&package-manager=npm_and_yarn&previous-version=5.0.0-rc.17&new-version=5.0.0-rc.20)](https://dependabot.com/compatibility-score.html?dependency-name=@aragon/wrapper&package-manager=npm_and_yarn&previous-version=5.0.0-rc.17&new-version=5.0.0-rc.20)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in the `.dependabot/config.yml` file in this repo:\n- Update frequency\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
