      "body": "Bumps [http-server](https://github.com/http-party/http-server) from 0.11.1 to 0.12.0.\n<details>\n<summary>Commits</summary>\n\n- [`e6f6358`](https://github.com/http-party/http-server/commit/e6f6358c900dceac5593eae0c4aed32b09475feb) 0.12.0\n- [`fee644f`](https://github.com/http-party/http-server/commit/fee644f5908cd2723817846c43ad8fa069618b47) fix repo urls\n- [`cd0bbc8`](https://github.com/http-party/http-server/commit/cd0bbc885d831dd9b234d5597a17b87e5e0e8842) SSL Certificate Checking and Grammar Fixes ([#479](https://github-redirect.dependabot.com/http-party/http-server/issues/479))\n- [`3c5dfc6`](https://github.com/http-party/http-server/commit/3c5dfc6c256d207662a15ba33adc735e86629d2d) Test on osx ([#576](https://github-redirect.dependabot.com/http-party/http-server/issues/576))\n- [`9fa7e93`](https://github.com/http-party/http-server/commit/9fa7e937204c9fd2f6f5ebb99aff59b98b5611ef) Merge pull request [#575](https://github-redirect.dependabot.com/http-party/http-server/issues/575) from http-party/update-readme-badges\n- [`6b2fe25`](https://github.com/http-party/http-server/commit/6b2fe2577604a09c5582168f1402c879ab51c840) test on osx\n- [`0f65fc6`](https://github.com/http-party/http-server/commit/0f65fc67ab917423906c8a8fbdd55917efe7b8e1) update readme badges to use new repo\n- [`a306ebc`](https://github.com/http-party/http-server/commit/a306ebcde37be080e843ae46e1cb80c8785f64ba) Merge pull request [#573](https://github-redirect.dependabot.com/http-party/http-server/issues/573) from Xmader/test-on-windows\n- [`9a0f64f`](https://github.com/http-party/http-server/commit/9a0f64f9afe5691e723baa1139ef74941926dbd9) force to use ecstatic v3.3.2 in tests ([#574](https://github-redirect.dependabot.com/http-party/http-server/issues/574))\n- [`5f06ac8`](https://github.com/http-party/http-server/commit/5f06ac85c8b8dd4a7fdc0f601da59b23137327e0) bump ecstatic in package.json to ^3.3.2\n- Additional commits viewable in [compare view](https://github.com/http-party/http-server/compare/0.11.1...v0.12.0)\n</details>\n<details>\n<summary>Maintainer changes</summary>\n\nThis version was pushed to npm by [thornjad](https://www.npmjs.com/~thornjad), a new releaser for http-server since your current version.\n</details>\n<br />\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=http-server&package-manager=npm_and_yarn&previous-version=0.11.1&new-version=0.12.0)](https://dependabot.com/compatibility-score.html?dependency-name=http-server&package-manager=npm_and_yarn&previous-version=0.11.1&new-version=0.12.0)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in the `.dependabot/config.yml` file in this repo:\n- Update frequency\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
