      "body": "# 🦅 Pull Request\r\n\r\nPart of the refactor effort https://github.com/aragon/aragon-cli/issues/858.\r\n\r\nThis PR builds on existing work that moved logic from the command file to `/lib`. However the functions in `/lib` are highly coupled with the current front-end rendered `listr`. The roadmap of this PR is:\r\n\r\n- [x] Remove listr task and ctx functionality from lib/start functions\r\n- [ ] Test lib functions\r\n\r\nTo complete the first part, the logic had to be moderately modified, as the `ctx` object was used as an integral part of the logic. Then I request @0xGabi and @0x6431346e to review that the current logic is correct and I did not ignore some detail during the refactor. To clarify:\r\n- Does the client build files from aragen require `npm install` and `npm run build`?\r\n- When the user provides a clientPath via yargs, should we run `npm install` and `npm run build` on it?",
