        "following_url": "https://api.github.com/users/dapplion/following{/other_user}",
        "gists_url": "https://api.github.com/users/dapplion/gists{/gist_id}",
        "starred_url": "https://api.github.com/users/dapplion/starred{/owner}{/repo}",
