      "body": "#### Plan for iteration v2\r\nThe code used in this command is massive and with abstractions that difficult moving the logic to `/lib`. Some amount of refactoring on the logic must be done in order to (1) properly separate the logic from the front-end, (2) move it to `/lib` and, (3) test it. Due to this, an e2e that completely covers the entire command is **mandatory** before moving forward. Also, ideally, the abstractions should be rethought to ease testing and moving the code to `/lib`. It will all depend on how much code @0xGabi and @ajsantander agree on changing.\r\n\r\n- [ ] Add e2e tests for the main use cases of `apm publish` and make sure it works in `master` or `develop`.\r\n- [ ] Move this interactive from util to a front-end file/function\r\nhttps://github.com/aragon/aragon-cli/blob/5a3dc58447837fe06075749165e820651e4510e0/packages/aragon-cli/src/commands/apm_cmds/util/generate-artifact.js#L80-L89\r\n- [ ] Rethink the utils/helpers to decouple logic from side-effects (file system read/writes) to ease unit testing.\r\n- [ ] Move these atomic, logical, testable utils/helpers to `/lib`.\r\n- [ ] (if applicable) Divide the publish tasks in smaller testable blocks, but bigger than single utils/helpers, Then, move then to `/lib`. \r\n- [ ] Move these atomic, logical, testable tasks to `/lib`.\r\n- [ ] Successful fully tested refactor!\r\n\r\n-----\r\n\r\n#### Iteration 1 work\r\n\r\nSubtask of #871.\r\n\r\n- [x] Split publish.js for each task it contains\r\n- [x] Move interactive input questions from utils / handlers\r\n- [x] Move logic (utils / helpers) to `/lib`\r\n- [ ] Unit test them\r\n\r\n\r\n\r\n\r\n",
