      "body": "# 🦅 Pull Request\r\n\r\n<!-- Please let us know why do you wish to include this change. 👇 -->\r\n\r\nFollowing @sohkai proposal in https://github.com/aragon/aragon-cli/issues/370 this PR adds a \"linter\" which asserts that the contract roles and arapp.json roles match (same ID and number of params). If not, it will error with:\r\n```\r\n✖ Role usage and declarations in arapp.json do not match: \r\n - MANAGE_PAYMENTS_ROLE2 is declared but never used\r\n - Function setPaymentStatus uses undeclared role MANAGE_PAYMENTS_ROLE\r\n - Function setPaymentStatus uses EXECUTE_PAYMENTS_ROLE with 2 params but requires 3\r\n```\r\n\r\nTo do this, a helper traverses the AST instead of using regex like other helpers (`solidity-extractor.js`). I believe this approach is more resilient than regex and more flexible to different code styles. Please note that the `ast-extractor.js` module is fully tested against the Finance and Voting artifacts. All other functions used in this PR are covered by unit tests. Regarding the AST parsing, it does a best effort to resolve expressions in the modifier second parameter but it could be fooled by weird helpers.\r\n\r\n**Feedback request**: \r\n1. Right now the assert is strict error-ing if something is not right. Should it be changed for a non-stopping warning?\r\n2. This functionality is called via `assertContractRoles(cwd, module)` in the `aragon apm publish` command at the beginning of the `runPrepareForPublishTask` and after `runSetupTask` which compiles .sol files, a necessary step for it. Is this the best place to do this check?\r\n3. The tests need build artifacts to run against. Is it ok to have then in the CLI codebase or is there a better approach to get them?\r\n\r\n## 🚨 Test instructions\r\n\r\n<!-- In case it is difficult or not straightforward to test this change,\r\nplease provide test instructions! -->\r\n\r\nChange the `role`s of an arapp.json so they don't match the ones in the contract. For example, in Finance app change `MANAGE_PAYMENTS_ROLE` name to `MANAGE_PAYMENTS_ROLE2`, and add one extra param to `EXECUTE_PAYMENTS_ROLE`. Then run:\r\n```\r\nlion$ node aragon apm publish major Finance\r\n✖ Role usage and declarations in arapp.json do not match: \r\n - MANAGE_PAYMENTS_ROLE2 is declared but never used\r\n - Function setPaymentStatus uses undeclared role MANAGE_PAYMENTS_ROLE\r\n - Function setPaymentStatus uses EXECUTE_PAYMENTS_ROLE with 2 params but requires 3\r\n```\r\n\r\n## ✔️ PR Todo\r\n\r\n- [x] Include links to related issues/PRs\r\n- [x] Update unit tests for this change\r\n- [x] Update the relevant documentation\r\n- [x] Clear dependencies on other modules that have to be released before merging this\r\n\r\n<!--\r\nThank you for contributing! \r\n\r\nTo help us review this change in a timely manner, please make sure to read and follow the \r\n[CONTRIBUTING](https://github.com/aragon/aragon-cli/blob/master/CONTRIBUTING.md) guidelines.\r\n-->\r\n",
